                  value={code}
                //   onChange={handleRankChange}
                onchange={(e)=> setCode(e.target.value)}
                  />
              
                <input style={{marginBottom:"20px", paddingBottom:"10px"}} className="flex"
                  placeholder="Area"
                  name="area"
                  value={area}
                  onChange={(e)=> setArea(e.target.value)}
