                  <label style={{marginBottom:"40px", fontWeight:"bold"}}>:</label> 
                  <label style={{marginBottom:"40px", fontWeight:"bold"}}>:</label>
                  <label style={{marginBottom:"40px", fontWeight:"bold"}}>:</label>
